import Moviely from './moviely';

class Header extends Component {
    render() {
        return (
            <div>
                <nav class="navbar bg-light">
                    <div class="container-fluid">
                    <span class="navbar-brand">Moviely</span>
                    </div>
                </nav>
            </div>
        );
    }
}

export default Header;
